import * as React from 'react';
import api from './api'

  function allUsers(){

    const [users, setUserGet] = React.useState([]);

    React.useEffect(() => {
      api
        .get("/v1/Users")
        .then((response) => ((setUserGet(response.data))))
        .catch((err) => {
          console.error("ops! ocorreu um erro" + err);
        });
      }, []);

      return users;
  }
